import React from 'react';
import PropTypes from 'prop-types';
import Styled from 'react-styleguidist/lib/client/Stylrsg-components/Styled';
// import Logo from 'react-styleguidist/lib/client/rsg-components/Logo';
// Import default implementation from react-styleguidist using the full path
// import StyleGuideRenderer from 'react-styleguidist/lib/client/rsg-components/StyleGuide/StyleGuideRenderer';
// import StyleGuideRenderer from './StyleGuideRenderer';

const styles = ({ fontFamily, space }) => ({
	headingSpacer: {
		marginBottom: space[2],
	},
	descriptionText: {
		marginTop: space[0],
		fontFamily: fontFamily.base,
	},
});

export function Components({
	classes,
	title,
	version,
	homepageUrl,
	children,
	toc,
	hasSidebar,
}) {
	return (
		<div>
			<div 
			classes={classes} 
			title={title}
			version={version}
			homepageUrl={homepageUrl}
			children={children}
			toc={toc}
			hasSidebar={hasSidebar}
			>

			</div>
		</div>
	);
}

Components.propTypes = {
	classes: PropTypes.object.isRequired,
	title: PropTypes.string.isRequired,
	version: PropTypes.string,
	homepageUrl: PropTypes.string.isRequired,
	children: PropTypes.node.isRequired,
	toc: PropTypes.node.isRequired,
	hasSidebar: PropTypes.bool,
};


export default Styled(styles)(Components);
